svg.script:
		function Speak(msg){
			if ('speechSynthesis' in window) {
				let u = new SpeechSynthesisUtterance(msg);
				u.rate = 1.1;
				u.lang = "de-DE";
				window.speechSynthesis.speak(u);
			} else {
				console.error("Browser not supported!!!");
            }
		}
		if ('speechSynthesis' in window) {

		} else {
            alert("Bitte einen anderen Browser nutzten!!");
        }
		setTimeout(function(){
			Speak("Diese Animation wurde nur mit einem Text-Editor erstellt!");	
		}, 500);
		setTimeout(function(){			
			Speak("Heute geht es um die Essigsäure.");
			Speak("Zunächst einmal die Definition der wichtigsten Begriffe.");
			Speak("Der Eisessig ist chemisch gesehen reine Essigsäure. Er ist ein farbloser Stoff mit einem stechenden Geruch. Er verdampft bei einer Temperatur von 118 °C und schmiltzt ab 16,5°C.");
			Speak("Da er im gefrohrenen Zustand wie Eis aus sieht, wird er auch Eisessig genannt!");

			Speak("Die Essigsäure ist ein Rein-Stoff, deren Summenformel CH3, C O O H lautet. Näheres zu Aufbau und Eigenschaften später...");

			Speak('Der Begriff "Essig" ist gesetzlich definiert und meint eine Essigsäure-Lösung mit einem typischen Essigsäure-Anteil von 5 bis 6%. Maximal 15,5%. Er ist zum Verzehr geeignet.');

			Speak('Hier noch einmal die Eigenschaften der Essigsäure aufgelistet:');
			Speak('Doch warum sind Siede und Schmelztemperatur im Vergleich zu Propan-1-ol und Propanal so hoch?');

			Speak('Schauen wir uns den Aufbauer der Essigsäure doch etwas genauer an:');
			Speak('Die Funktionelle-Gruppe der Essigsäure ist die stark polare Carboxylgruppe.');
			Speak('Mit ihrer Hilfe können 2 Wasserstoff-Brücken zwischen 2 Molekülen entstehen.');

			Speak('Im Vergleich dazu das Propan-1-ol Molekül. Es hat weder start polarisierte H-Atome, noch geignete freie Elektronenparre um eine starke Bindung mit Hilfe von H-Brücken einzugehen.');
			Speak("Da man beim Wechsel in einen energie-reicheren Aggregats-zustand mehr Energie zu führen muss, ist die Siedetemperatur der Essigsäure deutlich höher.");

			Speak("Gibt man Essigsäure in Wasser entstehen 3 Arten von Ionen. Die positiv geladenen Kathionen (Hier die Oxonium-Ionen) werden von der negativ geladenen Kathode angezogen. Hier nehmen sie ein Elektron auf und werden so wieder neutral. Die negativ geladenen Anionen (hier die Säure-Rest-Ionen Azetat und Ethanoat-Ion) wandern zur positiven Anode. Hier geben sie ein Elektron ab. Auch sie werden so neutral. Bewegte Ladungen (hier Elektronen) kennzeichnen einen Stromfluss. Die Lösung leitet also den elektrischen Strom!");

			Speak("Die Essigsäure ist eine schwache Säure, da sie in Lösung nur teilweise protolysiert vorliegt, also nicht alle Molekühle zu Oxonium und Säure-Rest-Ion reagieren. Dadurch liegen relativ wenige Oxonium-Ionen in der Lösung vor.");

			Speak("Die Essigsäure eignet sich wunderbar zum Reinigen, da sie mit dem Kalk zu löslichem Calziumacetat und Kohlensäure reagiert. So entfernt sie den Kalk. Die Kohlensäure zerfällt sofort zu C O 2 und Wasser.");

			Speak("Die Essigsäure reagiert auch mit unedlen Metallen. Als Beispiel nehmen wir die Reaktion mit Magnesium.");
			Speak("Dieses reagiert mit der Essigsäure zu Magnesiumacetat und Wasserstoff.");

            Speak("Hier noch eine Liste mit üblichen Verwendungszwecken von Essigsäure.");
		}, 5000);
